import "./styles.css";

export default function App() {
  return Article();
}

function Article() {
  <div className="article">
    <h2 className="article_title">This is not a test!</h2>
    <label htmlFor="test"></label>
    <input id="test" type="text">
      something
    </input>
    <a href="https://www.wikipedia.org/" className="article_link"></a>
  </div>;
}
